var text = ["","A chemical equation gives a rule for how molecules react with one another. However, it does not describe a single state of a chemical system. Instead, the reaction leads to a range of possible states that we can view as lying along a coordinate that we will call the progress of reaction.","To illustrate what we mean by progress of reaction will use the dimerization of NO<sub>2</sub> to form N<sub>2</sub>O<sub>4</sub>. This reaction occurs in the gas phase and we will draw these molecules in a container as shown here. The colors of our molecules are brown for NO<sub>2</sub> and grey for N<sub>2</sub>O<sub>4</sub>, which represent the actual colors of the gas molecules in the reaction because NO<sub>2</sub> is a brown gas and N<sub>2</sub>O<sub>4</sub> is a colorless gas.","We can define the progress of a reaction as the relative amount of NO<sub>2</sub> that has been converted to N<sub>2</sub>O<sub>4</sub>.","These diagrams show a range of possible states for the NO<sub>2</sub> reaction. The maximal number of NO<sub>2</sub>s in this case is 10, shown in the far left box.","As we move one box to the right, 2 NO<sub>2</sub>s have reacted to form a single N<sub>2</sub>O<sub>4</sub>.","In the next box to the right, an additional N<sub>2</sub>O<sub>4</sub> has been formed, and so on until...","...the far right-hand side, in which all of the NO<sub>2</sub>s have been converted to N<sub>2</sub>O<sub>4</sub>. The maximal number of N<sub>2</sub>O<sub>4</sub>s is 5 in this case.","This graphic provides a convenient visual representation of the progress of reaction. As we move from left to right, reactants combine to form products. As we move from right to left, products break up to form reactants.","The very far right corresponds to the limiting reagent situation in which the forward reaction has progressed until all of the reactants have run out.","Conversely, the leftmost box corresponds to the limiting reagent situation in which the reverse reaction has progressed until all of the products have run out. Since chemical equilibrium systems involve reversible reactions, the equilibrium state lies between these end points. We will use a variable called the reaction quotient, Q to determine where along this continuum a system currently resides and the equilibrium constant, K, to determine where the system resides when it reaches the steady equilibrium state.","The reaction quotient, Q, is the mathematical entity that we use to capture the position along this continuum. As we'll see below, Q is a valuable tool for thinking about equilibrium systems.  Let's write the formula for Q for a general reaction in which reactants A and B react to form products C and D, with the stoichiometric coefficients lowercase a, b, c and d.","Q gives an indication of the progress of the forward reaction.","The formula for the reaction quotient, Q, is a ratio of concentrations.","The concentrations of products raised to their stoichiometric coefficients are in the numerator.","The concentrations of reactants raised to their stoichiometric coefficients are in the denominator.","If the reaction occurs in a solution, the concentrations are given in molarity, M.","If the reaction involves gases, like our NO<sub>2</sub> example, the concentration of reactants and products are expressed as partial pressures in atmospheres.","Our example reaction is this: 2 NO<sub>2</sub> molecules combine to form one N<sub>2</sub>O<sub>4</sub> molecule.","Q is the ratio of the concentration of products to reactants.","For this example, the equation takes the following form: the partial pressure of N<sub>2</sub>O<sub>4</sub> divided by the partial pressure of NO<sub>2</sub> squared, with the pressure being expressed in atm.","Let's return to our sequence of boxes, and calculate Q, the reaction quotient, for each of them. When we calculate Q, the values are always in partial pressures or concentrations.","Weâ€™ll assume that we are looking at a small portion of the gas, with the size of our viewing area such that the partial pressure is one atmosphere for each molecule we see.","The partial pressure of N<sub>2</sub>O<sub>4</sub> increases from zero to 5 atmospheres as the forward reaction progresses and we go from left to right. This direction corresponds to converting reactants into products.","Conversely, the partial pressure of NO<sub>2</sub> increases from zero to 10 as the reverse reaction progresses and we go from right to left. This direction corresponds to converting products into reactants.","The reaction quotient, Q, is given by a ratio of the partial pressures of products over reactants. Like we saw above, Q equals the partial pressure of N<sub>2</sub>O<sub>4</sub>/(NO<sub>2</sub>)<sup>2</sup>.","We fill in the values for each snapshot of the reaction and calculate Q.","On the far left, Q = 0, because the partial pressure of N<sub>2</sub>O<sub>4</sub> is zero. Q increases as we move to the right.","At the far right, the partial pressure of NO<sub>2</sub> is zero, so the value of Q becomes infinite.","However, reversible reactions don't ever end up at either of these extremes because the reaction never totally stops like non-reversible reactions do.","Instead, the reversible reactions will eventually reach a <b>steady state</b> - where some reactants are being converted to products and vice versa, but the total amounts of reactants and products isn't changing - Q is not changing.  We'll explore this in more detail in the next module, which discusses equilibrium constants and the Law of Mass Action."];

